// 日期 配合正则
export const dateOrigin = {
    year:(()=>{
        let tempArr = []
        const nowYear = new Date().getFullYear()
        for(let i=0;i<10;i++){
            tempArr.push(i+nowYear)
        }
        return tempArr
    })(),
    month:(()=>{
        let tempArr = []
        for(let i=0;i<12;i++){
            tempArr.push(i+1>9 ? i+1 : '0'+(i+1))
        }
        return tempArr
    })(),
    day:(()=>{
        let tempArr = []
        for(let i=0;i<31;i++){
            tempArr.push(i+1>9 ? i+1 : '0'+(i+1))
        }
        return tempArr
    })()
}

